// Go

$(function(){

  // submenu
  $(".has-submenu__link").on("click", function(e){
    e.preventDefault();
    $(".sub-nav").stop().slideToggle(300);
  });

  // mobile nav

  var $navMobile = $(".nav-mobile");
  var $nav = $(".nav");

  // костыль для тестирования

  $( window ).on( "resize", function(){
		var $widthWindow = window.innerWidth;

    if($widthWindow > 992){
      $navMobile.removeAttr('style');
      $nav.removeAttr('style');
    }
	});

  $navMobile.on("click", function(){
    $(this).fadeOut(200);
    
    $nav.animate(
      {
        'left': 0
      },
      {duration: 500}
    );
  });

  $(".nav-close").on("click", function(){
    $nav.animate(
      {
        'left': '-350px'
      },
      {duration: 500,
        complete: function(){
          $navMobile.fadeIn(100);
        }
      });
  });


  // меню colorbox

  $(".has-doc").colorbox({
    maxWidth: '1148px',
    width: '90%',
    height: 'auto',
    opacity: '.8',
    title: false,
    scrolling: false,
    onComplete : function() { 
       $(this).colorbox.resize(); 
    }
  });

  $(".has-form").colorbox({
    innerWidth: '470px',
    maxWidth: '470px',
    width: '100%',
    height: 'auto',
    opacity: '.8',
    title: false,
    scrolling: false,
    onComplete : function() { 
       $(this).colorbox.resize(); 
    }
  });

  // скролим до слайдеров

     $(".has-scroll").on("click", function(){
      $id = $(this).data("id");
      console.log($id);
      $.scrollTo( $id, 800, {offset:-50});
      return false;
    });

  // графики
    var $topHeight = $(".top").height();
    var $plusesHeight = $(".pluses").height();

    // считаем высоту до блока, чтобы мы видели что графики крутятся когда докручиваем до них
      var $sumChart = $topHeight + $plusesHeight - 400;
    
     $(window).scroll(function(e){

      
     
      // сколько пикселей промотали
      var $scrollHeight = $(window).scrollTop();

      // ширина графика
      var $widthWindow = window.innerWidth;
      var $widthCanvas;

      $widthWindow < 1400 ? $widthCanvas = 150 : $widthCanvas = 200;
      
      
      if ( $scrollHeight > $sumChart ) {
        
            $('.chart').easyPieChart({
                animate: 1000,
                size: $widthCanvas,
                lineWidth: 32,
                scaleColor: false,
                lineCap: 'butt',
                trackColor: '#fff',
                scaleLength: false
            });
      }

});

      // если не промотали, а обновили страницу где графики
      $heightNow = window.pageYOffset;
      
      if ( $heightNow > $sumChart) {
        
            $('.chart').easyPieChart({
                animate: 1000,
                size: $widthCanvas,
                lineWidth: 32,
                scaleColor: false,
                lineCap: 'butt',
                trackColor: '#fff',
                scaleLength: false
            });
      }
   
// Поскольку в канвасе графика стили прописываются инлайн, придется менять их тут

var $widthWindow = window.innerWidth;
var $canvas = $(".chart canvas");


$(window).on("resize", function(){
    $widthWindow = window.innerWidth;
    $canvas = $(".chart canvas");

    // дефолт
    $canvas.css({
      "width" : "200px",
      "height" : "200px"
    });

    if($widthWindow < 1400){
      $canvas.css({
        "width" : "150px",
        "height" : "150px"
      });
    }

	});

  // слайдеры

  $('.slider-carousel-1').slick({
    arrows:false,
    autoplay: true,
    centerMode: true,
    slidesToShow: 5,
    slidesToScroll:1,
    centerPadding: '20px',
    variableWidth: true
  });

  $('.slider-carousel-2').slick({
    arrows:false,
    autoplay: true,
    centerMode: true,
    slidesToShow: 7,
    slidesToScroll:1,
    centerPadding: '20px',
    variableWidth: true
  });

  $('.slider-carousel-3').slick({
    arrows:false,
    autoplay: true,
    centerMode: true,
    slidesToShow: 2,
    slidesToScroll:1,
    centerPadding: '20px',
    variableWidth: true
  });

  $('.slider-carousel-4').slick({
    arrows:false,
    autoplay: true,
    centerMode: true,
    slidesToShow: 8,
    slidesToScroll:1,
    centerPadding: '20px',
    variableWidth: true
  });

  // video
     
      // Открываем видео при клике на ссылку

      $(".has-video").on("click", function(e){
        e.preventDefault();
        
        // показываем overlay
        $(".video-overlay").css({
          "display": "block",
          "height" : $(document).height(),
        });

        $(".video").css("display", "block");

        // грузим видео
        // долго грузится, можно воткнуть лоадер какой-нибудь
        $.ajax({
          url: "ajax/video.html",
        })
        .done(function( html ) {
          $( ".video" ).append( html );

            // Считаем размеры видео и отступов

            var $videoWidth = $widthWindow*0.65;
            var $videoMargin = $widthWindow*0.025;
            $(".video__item")
              .css("margin-left", $videoMargin)
              .css("margin-right", $videoMargin);
            
            $(".video__item iframe") 
              .css("width", $videoWidth)
        
        
            $('.video__slider').slick({
              arrows:false,
              slidesToShow: 3,
              centerMode: true,
              slidesToScroll:1,
              variableWidth: true,
              swipeToSlide: true
            });
          });
      });

      // закрываем слой видео при клике на слой
      $(".video-overlay").on("click", function(){
        $(this).css("display", "none");
        $(".video").css("display", "none").empty();
      })

      // теперь надо в онресайз повторить.

      $(window).on("resize", function(){
        var $videoWidth = $widthWindow*0.65;
        var $videoMargin = $widthWindow*0.05;

        $(".video__item")
          .css("margin-left", $videoMargin)
          .css("margin-right", $videoMargin);

        $(".video__item iframe") 
          .css("width", $videoWidth);

      });

      // Грузим блок с рекламой радио/теле/остльного

      $(".slider-carousel__link").on("click", function(e){
        e.preventDefault();
        $(this).stop();
        var $link = $(this).attr("href")
        $.ajax({
          url: $link,

          success: function(data){
            $('.about-partner').html(data).slideDown(500);
          }
        })

      });


});